#!/bin/bash
set -euo pipefail
cd /testbed
# Restore ENTIRE test suite from embedded tarball
# The agent cannot run any tests because all test dirs were removed
# This script restores them for verification (runs after agent completes)
ALL_TESTS_TARBALL=""
if [ -n "$ALL_TESTS_TARBALL" ]; then
    echo "Restoring complete test suite for verification..."
    echo "$ALL_TESTS_TARBALL" | base64 -d | tar -xzf - -C /testbed
    if [ $? -eq 0 ]; then
        echo "Restored test suite"
    else
        echo "WARNING: Failed to restore test suite from tarball"
    fi
fi

npx vitest run --reporter verbose --pool-options.threads.minThreads=1 --pool-options.threads.maxThreads=1 > /tmp/out.txt 2>&1 || true
cat /tmp/out.txt

# Check if fail_to_pass tests now pass
# Uses the EXACT same parse_test_output() logic as validate_patch_ephemeral
python3 << 'INNERPY'
import json
import re
import sys

def parse_test_output(test_output):
    """Parse test runner output to extract passing/failing test names.
    
    This is the EXACT same logic as validate_patch_ephemeral uses.
    Supports: Vitest, Jest, Mocha, Lodash, AVA, borp, TAP, nodeunit.
    """
    passing = set()
    failing = set()
    passing_files = set()
    failing_files = set()

    # Symbols for passing/failing individual tests
    pass_symbols = ["", ""]
    fail_symbols = ["", "", "", ""]

    ansi_escape = re.compile(r"\x1B\[[0-?]*[ -/]*[@-~]")

    def is_file_path_only(s):
        if " > " in s:
            return False
        return "/" in s and (
            s.endswith(".js") or s.endswith(".ts") or
            s.endswith(".jsx") or s.endswith(".tsx") or
            s.endswith(".spec.js") or s.endswith(".test.js") or
            s.endswith(".spec.ts") or s.endswith(".test.ts")
        )

    def is_vitest_file_summary(s):
        return bool(re.search(r"\(\d+\s+tests?\)", s))

    def extract_file_path(s):
        match = re.match(r"^(?:PASS|FAIL)\s+(.+\.(js|ts|jsx|tsx))(?:\s|$)", s)
        if match:
            return match.group(1).strip()
        return None

    def normalize_vitest_test_name(test_name):
        if test_name.startswith("TS "):
            test_name = test_name[3:]
        test_name = " ".join(test_name.split())
        return test_name.strip()

    in_failure_section = False

    for line in test_output.split("\n"):
        line_clean = ansi_escape.sub("", line)
        line_stripped = line_clean.strip()

        # Track file-level PASS/FAIL lines for Jest
        if line_stripped.startswith("PASS "):
            file_path = extract_file_path(line_stripped)
            if file_path:
                passing_files.add(file_path)
            continue
        elif line_stripped.startswith("FAIL "):
            file_path = extract_file_path(line_stripped)
            if file_path:
                failing_files.add(file_path)
            continue

        # Check for failing tests
        if any(symbol in line_stripped for symbol in fail_symbols):
            test_name = line_stripped
            for symbol in fail_symbols:
                test_name = test_name.replace(symbol, "").strip()
            test_name = re.sub(r"\s*\(\d+\.?\d*\s*m?s\)\s*$", "", test_name).strip()
            
            if is_vitest_file_summary(test_name):
                continue

            if test_name and not is_file_path_only(test_name):
                test_name = normalize_vitest_test_name(test_name)
                if test_name:
                    failing.add(test_name)

        # Check for passing tests
        elif any(symbol in line_stripped for symbol in pass_symbols):
            test_name = line_stripped
            for symbol in pass_symbols:
                test_name = test_name.replace(symbol, "").strip()
            test_name = re.sub(r"\s*\(\d+\.?\d*\s*m?s\)\s*$", "", test_name).strip()
            
            if is_vitest_file_summary(test_name):
                continue

            if test_name and not is_file_path_only(test_name):
                test_name = normalize_vitest_test_name(test_name)
                if test_name:
                    passing.add(test_name)

        # Mocha numbered failures like "1) test name"
        elif re.match(r"^\d+\)", line_stripped):
            test_name = re.sub(r"^\d+\)\s*", "", line_stripped).strip()
            if test_name and not test_name.startswith("Error") and not test_name.startswith("Uncaught"):
                failing.add(test_name)
                in_failure_section = True

        elif not line_stripped:
            in_failure_section = False

    # VITEST DETECTION: Add synthetic marker for consistency
    vitest_summary_pattern = r"Tests\s+(\d+)\s+passed"
    vitest_fail_pattern = r"(\d+)\s+failed"
    
    vitest_match = re.search(vitest_summary_pattern, test_output)
    if vitest_match:
        passed_count = int(vitest_match.group(1))
        fail_match = re.search(vitest_fail_pattern, test_output)
        failed_count = int(fail_match.group(1)) if fail_match else 0
        
        if failed_count > 0:
            failing.add("vitest_test_suite")
        if passed_count > 0:
            passing.add("vitest_test_suite")
    elif passing or failing:
        has_vitest_tests = any(" > " in t for t in passing | failing)
        if has_vitest_tests:
            if failing:
                failing.add("vitest_test_suite")
            if passing:
                passing.add("vitest_test_suite")

    # LODASH FALLBACK
    if not passing and not failing:
        lodash_pattern = r"PASS:\s*(\d+)\s+FAIL:\s*(\d+)\s+TOTAL:\s*(\d+)"
        for line in test_output.split("\n"):
            match = re.search(lodash_pattern, line)
            if match:
                failed_count = int(match.group(2))
                if failed_count > 0:
                    failing.add("lodash_all_tests")
                else:
                    passing.add("lodash_all_tests")
                break
        
        # CRASH FALLBACK for lodash
        if not passing and not failing and ("test:main" in test_output or "test:fp" in test_output):
            crash_indicators = ["SyntaxError", "ReferenceError", "TypeError", "Error:", 
                               "FAIL |", "throw ", "Cannot read properties", 
                               "is not defined", "Unexpected token"]
            if any(ind in test_output for ind in crash_indicators):
                failing.add("lodash_all_tests")

    # AVA FALLBACK
    if not passing and not failing:
        ava_passed_pattern = r"(\d+)\s+tests?\s+passed"
        ava_failed_pattern = r"(\d+)\s+tests?\s+failed"
        
        passed_match = re.search(ava_passed_pattern, test_output)
        failed_match = re.search(ava_failed_pattern, test_output)
        
        if passed_match or failed_match:
            passed_count = int(passed_match.group(1)) if passed_match else 0
            failed_count = int(failed_match.group(1)) if failed_match else 0
            
            if failed_count > 0:
                failing.add("ava_test_suite")
            if passed_count > 0:
                passing.add("ava_test_suite")

    # BORP FALLBACK (Fastify)
    if not passing and not failing:
        borp_tests_pattern = r"\s*tests\s+(\d+)"
        borp_pass_pattern = r"\s*pass\s+(\d+)"
        borp_fail_pattern = r"\s*fail\s+(\d+)"
        
        tests_match = re.search(borp_tests_pattern, test_output)
        pass_match = re.search(borp_pass_pattern, test_output)
        fail_match = re.search(borp_fail_pattern, test_output)
        
        if tests_match and pass_match:
            passed_count = int(pass_match.group(1))
            failed_count = int(fail_match.group(1)) if fail_match else 0
            
            if failed_count > 0:
                failing.add("borp_test_suite")
            if passed_count > 0:
                passing.add("borp_test_suite")

    # JEST SUMMARY FALLBACK
    if not passing and not failing:
        jest_summary_pattern = r"Tests:\s+(\d+)\s+passed"
        jest_failed_pattern = r"(\d+)\s+failed"
        
        jest_pass_match = re.search(jest_summary_pattern, test_output)
        jest_fail_match = re.search(jest_failed_pattern, test_output)
        
        if jest_pass_match:
            passed_count = int(jest_pass_match.group(1))
            failed_count = int(jest_fail_match.group(1)) if jest_fail_match else 0
            
            if failed_count > 0:
                failing.add("jest_test_suite")
            if passed_count > 0:
                passing.add("jest_test_suite")

    # NODEUNIT FALLBACK
    if not passing and not failing:
        nodeunit_passed_pattern = r">>\s*(\d+)\s+assertions?\s+passed"
        nodeunit_failed_pattern = r"(\d+)\s+(?:assertions?\s+)?failed"
        
        passed_match = re.search(nodeunit_passed_pattern, test_output)
        failed_match = re.search(nodeunit_failed_pattern, test_output)
        
        ok_count = len(re.findall(r"Testing\s+\S+\.js[.\s]+OK", test_output))
        fail_count = len(re.findall(r"Testing\s+\S+\.js[.\s]+FAILED", test_output))
        
        if passed_match or ok_count > 0:
            passing.add("nodeunit_test_suite")
            if failed_match or fail_count > 0:
                failing.add("nodeunit_test_suite")

    # TAP FORMAT
    if not passing and not failing:
        tap_summary_pass = re.search(r"^#\s*pass\s+(\d+)", test_output, re.MULTILINE)
        tap_summary_fail = re.search(r"^#\s*fail\s+(\d+)", test_output, re.MULTILINE)
        
        if tap_summary_pass or tap_summary_fail:
            pass_count = int(tap_summary_pass.group(1)) if tap_summary_pass else 0
            fail_count = int(tap_summary_fail.group(1)) if tap_summary_fail else 0
            
            if pass_count > 0:
                passing.add("tap_test_suite")
            if fail_count > 0:
                failing.add("tap_test_suite")
        else:
            has_tap_header = "TAP version" in test_output
            tap_plan_match = re.search(r"^1\.\.(\d+)\s*$", test_output, re.MULTILINE)
            
            if has_tap_header or tap_plan_match:
                tap_pass_count = len(re.findall(r"^ok \d+", test_output, re.MULTILINE))
                tap_fail_count = len(re.findall(r"^not ok \d+", test_output, re.MULTILINE))
                
                if tap_pass_count > 0 or tap_fail_count > 0:
                    if tap_pass_count > 0:
                        passing.add("tap_test_suite")
                    if tap_fail_count > 0:
                        failing.add("tap_test_suite")

    return passing, failing, passing_files, failing_files


# Load test config with fail_to_pass tests
with open('/tests/config.json') as f:
    config = json.load(f)

fail_to_pass = set(config.get('FAIL_TO_PASS', []))

if not fail_to_pass:
    print("WARNING: No FAIL_TO_PASS tests defined")
    open('/logs/verifier/reward.txt','w').write('0')
    sys.exit(1)

# Read and parse test output using the SAME function as validation
out = open('/tmp/out.txt').read()
passing_tests, failing_tests, _, _ = parse_test_output(out)

print(f'Parsed {len(passing_tests)} passing tests, {len(failing_tests)} failing tests')

# Check which F2P tests are now passing
# A test is "truly passing" only if it's in passing AND NOT in failing
# This is critical for synthetic markers (jest_test_suite, etc.) which can appear
# in both sets when there are mixed pass/fail results
f2p_now_passing = fail_to_pass & passing_tests - failing_tests  # In passing, NOT in failing
f2p_still_failing = fail_to_pass & failing_tests
f2p_not_found = fail_to_pass - passing_tests - failing_tests

print(f'FAIL_TO_PASS tests:')
for test in sorted(f2p_now_passing):
    print(f'   {test} - now passing')
for test in sorted(f2p_still_failing):
    print(f'   {test} - still failing')
for test in sorted(f2p_not_found):
    print(f'  ? {test} - not found in output')

print(f'Summary: {len(f2p_now_passing)}/{len(fail_to_pass)} now passing')

# Success if ALL fail_to_pass tests now pass (and none are still failing)
if f2p_now_passing == fail_to_pass and len(f2p_still_failing) == 0:
    print('SUCCESS: All FAIL_TO_PASS tests are now passing!')
    open('/logs/verifier/reward.txt','w').write('1')
else:
    print(f'FAILURE: {len(fail_to_pass) - len(f2p_now_passing)} tests still failing or not found')
    open('/logs/verifier/reward.txt','w').write('0')
    sys.exit(1)
INNERPY
